WIKI = 'https://en.wikipedia.org/wiki/'

def get_index_symbols(index):
    if index.startswith('sp') and index[2:].isnumeric():
        if index == 'sp100':
            index = 'S&P_100'
        else:
            index = 'List_of_S&P_' + index[2:] + '_companies'
    elif index == 'ndx':
        index = 'NASDAQ-100'
    elif index == 'djia':
        index = 'Dow_Jones_Industrial_Average'
    else:
        raise ValueError('Invalid index provided')



    soup = BeautifulSoup(requests.get(WIKI + quote(index)).text, 'html.parser')
    symbols = []
    sym = -1


    url = WIKI + quote(index)
    print(f"Scraping Wikipedia page: {url}")

    # Locate the table with company data
    for table in soup.findAll("table", {'class': 'wikitable sortable'}):
        header = table.findAll('th')
        for i in range(len(header)):
            s = header[i].text.lower()
            if 'symbol' in s or 'ticker' in s:
                sym = i
                break

        # If symbol column index is found
        if sym != -1:
            for row in table.findAll('tr'):
                fields = row.findAll('td')

                # Check if the row has enough columns to avoid IndexError
                if len(fields) > sym and fields[sym].text:
                    symbol = fields[sym].text.strip()
                    if ':' in symbol:
                        symbol = symbol.split(':')[1].strip()
                    symbols.append(symbol)
            break

    if sym == -1:
        raise Exception('Cannot parse Wikipedia table!')

    return symbols

