import yfinance as yf
import pandas as pd

def get_financial_data(tickers):
    """
    Retrieve financial data for a list of tickers from Yahoo Finance.

    Parameters:
    tickers (list): A list of ticker symbols.

    Returns:
    DataFrame: A DataFrame containing relevant financial data for each ticker.
    """
    data = []

    for ticker in tickers:
        stock = yf.Ticker(ticker)

        # getting financial data
        info = stock.info

        # collecting relevant metrics
        try:
            revenue_growth = info.get("revenueGrowth", 0) * 100  # Convert to percentage
            eps_growth = info.get("earningsGrowth", 0) * 100      # Convert to percentage
            roe = info.get("returnOnEquity", 0) * 100             # Convert to percentage
            peg_ratio = info.get("pegRatio", None)
            ps_ratio = info.get("priceToSalesTrailing12Months", None)
            debt_to_equity = info.get("debtToEquity", None)
            market_cap = info.get("marketCap", 0)

            data.append({
                "Ticker": ticker,
                "Revenue Growth YoY (%)": revenue_growth,
                "EPS Growth (%)": eps_growth,
                "ROE (%)": roe,
                "PEG Ratio": peg_ratio,
                "P/S Ratio": ps_ratio,
                "Debt-to-Equity Ratio": debt_to_equity,
                "Market Cap": market_cap
            })
        except Exception as e:
            print(f"Error fetching data for {ticker}: {e}")

    return pd.DataFrame(data)

def screen_growth_stocks(tickers):
    """
    Screen stocks based on growth investment criteria for large-cap stocks.

    Parameters:
    tickers (list): A list of ticker symbols.

    Returns:
    DataFrame: A DataFrame of tickers that meet the growth investment criteria.
    """

    data = get_financial_data(tickers)

    screened_data = data[
        (data["Revenue Growth YoY (%)"] > 10) &
        (data["EPS Growth (%)"] > 10) &
        (data["ROE (%)"] > 15) &
        (data["PEG Ratio"] <= 1.5) &
        (data["P/S Ratio"] < data["P/S Ratio"].mean()) &
        (data["Debt-to-Equity Ratio"] < 1) &
        (data["Market Cap"] > 10e9)]

    return screened_data

filtered_stocks = screen_growth_stocks(tickers)
